import React from 'react';

function Skills() {
  const skills = ['Spring Boot', 'React.js', 'AWS', 'Kubernetes', 'Docker', 'CI/CD'];

  return (
    <section id="skills">
      <h2>Skills</h2>
      <div className="skills-carousel">
        {skills.map((skill, index) => (
          <div className="skill-card" key={index}>
            {skill}
          </div>
        ))}
      </div>
    </section>
  );
}

export default Skills;
